import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Main from '../pages/main/Main'
import Reshome from '../pages/restaurant/Reshome';
import Signup from '../pages/main/Usersignup';
import Login from '../pages/main/Userlogin'
import AdminHome from '../pages/admin/Adminhome'
import Deliverypartnerhome from '../pages/delivery/Deliveryhome'


function routes() {
  return (
    <Routes>
      {/* The root route with the Layout */}
      <Route path="/" element={<Main/>}>


        {/* Restaurant Home and its Login/Signup routes */}
        <Route path="restauranthome" element={<Reshome/>}>

        </Route>

        {/* Admin Home and its Login/Signup routes */}
        <Route path="adminhome" element={<AdminHome/>}>
          <Route path="login" element={<Login />} />
          <Route path="signup" element={<Signup />} />
        </Route>

        {/* Delivery Partner Home and its Login/Signup routes */}
        <Route path="deliverypartnerhome" element={<Deliverypartnerhome/>}>
          <Route path="login" element={<Login />} />
          <Route path="signup" element={<Signup />} />
        </Route>
      </Route>
    </Routes>
  );
}

export default routes;
